import React from "react";
import "./Form.scss";

const Form = () => {
  return (
    <div className="divForm">
      <label className="divForm_title">Enviar Tweet</label>

      <form name="name">
        <div className="divForm_text">
          <input type="text" className="divForm_inputText"></input>
        </div>

        <div className="divForm_textarea">
          <textarea
            className="divForm_textAreaModal"
            name="textAreaModal"
            rows="8"
            cols="50"
          ></textarea>
        </div>
      </form>
    </div>
  );
};

export default Form;
